INSERT INTO `service` (`id`, `category_id`, `name`, `price`, `description`, `duration`) VALUES
(1, 1, 'RM', '26', 'Massage vom Kreuzbein bis zum Haaransatz zur Entspannung und Muskellockerung', '25'),
(2, 1, 'Rü. ind.', '30', 'Wir behandeln Ihr Rückenproblem individuell mit unterschiedlichen Massage- und Behandlungstechniken. Diese Anwendung wird nur von ausgebildeten Masseuren und Physiotherapeuten durchgeführt.\r\nBeachten Sie auch unser Angebot "Rücken intensiv".', '25'),
(3, 1, 'Anti Stressm.', '29', 'Entspannende Schulter- Nacken- Kopfmassage mit sanfter Dehnung der Halswirbelsäule. Sehr zu empfehlen bei Spannungskopfschmerzen, Nervosität und zum Stressabbau', '25'),
(4, 1, 'GL', '26', 'Sanfte entstauende Massage von Dekolleté, Hals und Gesicht. Insbesondere bei Neigung zu geschwollenen Augen, Kopfschmerzen, Nervosität.', '25'),
(5, 1, 'Kopfschmerz.', '52', 'Besonders wunderbare Kombination aus Anti - Stressmassage und Gesichtslymphdrainage. Beide Anwendungen verstärken sich in der Wirkung und führen zu einer absoluten Entspannung', '50'),
(6, 1, 'Fussrefl.', '26', 'Alle Organe unseres Körpers sind über Energiebahnen mit den Füßen verbunden. Mit dieser Anwendung tun Sie Ihren Füßen und Ihrem Körper etwas Gutes', '25'),
(7, 1, 'Fussmas.', '26', 'Sanfte Ölmassage der Füße und Unterschenkel. Anschließend laufen Sie wie auf Wolken.', '25'),
(8, 1, 'GM', '27', 'Entspannt sichtbar trockene Haut und schenkt Wohlbefinden. Gesichtsreinigung und anschließende Gesichts- und Dekolletè-massage mit hochwertigem Vita SilkOil.', '25'),
(9, 1, 'GK- Sanddmas.', '55', 'Sanfte Massage von Rücken, Bauch, Armen und Beinen mit dem frisch- fruchtigen Sanddornöl.', '50'),
(10, 1, 'GK-Peelingmas.', '59', 'Warmes Aromaöl wird mit feinsten Jojobakügelchen gemischt, die sich bei der Peelingmassage auflösen. Sie werden mit seidig weicher, gut durchbluteter Haut belohnt. Entspannung pur!', '50'),
(11, 1, 'Ges. Hand. Fußmas.', '52', 'Eine etwas andere Massagekombination zum Wohlfühlen. Probieren Sie es einfach aus!', '50'),
(12, 1, 'Massagetraum', '85', 'Genießen Sie eine sanfte Ölmassage von den Haar- bis zu den Zehenspitzen. Entspannung pur!', '80'),
(13, 2, 'GK Kreidep.', '48', 'Das ist die ideale Anwendung um den vollen Therapie- und Entschlackungseffekt der Heilkreide auszuprobieren. Ihr ganzer Körper wird mit dem weichen, warmen, weißen Heilkreideschlamm eingerieben. Dann werden Sie auf unserer extra breiten, beheizbaren Wellnessliege entspannt gelagert und träumen bei sanfter Musik. Um den Therapieeffekt zu unterstützen sollten Sie an diesem Tag viel Wasser trinken und wenn Sie mögen in die Saune gehen, um über das Schwitzen die Ausscheidung der Säuren zu unterstützen.', '50'),
(14, 2, 'GK Kreidep. & GK Sanddornölmass.', '92', 'Genießen Sie eine Ganzkörperpackung mit Original Rügener Heilkreide und einer Ganzkörper-.Sanddornölmassage', '100'),
(15, 2, 'Vollbad mit Rügener Heilkreide', '55', 'Hierbei werden zwei Kilo Rügener Heilkreide in einem Wannenbad aufgelöst. Mit einem Basenpeeling werden alte Hautschüppchen entfernt und die Poren geöffnet um die Heilkreide aufzunehmen. Bei dieser Anwendung kommt es zu einer Übererwärmung des Körpers, was besonders bei rheumatischen Erkrankungen angestrebt wird. Darum sollten Sie sehr kreislaufstabil sein, keine Herzerkrankung oder Blutdruckprobleme haben. Sonst wählen Sie die sanftere Ganzkörperpackung.', '45'),
(16, 2, 'RP Kreide', '24', 'Die Rückenpackung wird warm aufgetragen und führt zu einer gesteigerten Durchblutung der Muskulatur. Wir empfehlen, die Rückenpackung in Verbindung mit einer Massage auszuprobieren.', '25'),
(17, 2, 'Entsp. Rück.', '46', 'Hierbei wird die Rückenpackung mit einer Relax- Rückenmassage verbunden.', '50'),
(18, 2, 'GP', '24', 'Durch die antiallergische Wirkung der Rügener Heilkreide kann diese Gesichtspackung individuell auf jeden Hauttyp abgestimmt werden.\r\nGemischt mit Honig, Milch und Olivenöl für trockene Haut oder nur angerührt mit Wasser bei Akne, entfaltet die Kreide je nach Wunsch ihr nachfettende oder austrocknende Wirkung.', '25'),
(19, 2, 'Rück. int.', '53', 'Wir behandeln Ihr Rückenproblem fachspezifisch und individuell mit unterschiedlichen Massage- und Behandlungstechniken. Anschließend erhalten Sie in der Nachruhe eine Kreidepackung zur Durchblutungsförderung und auch, um eventuellen Muskelkater zu vermeiden.', '50'),
(20, 2, 'Rücken Relax', '49', 'Wir verbinden eine warme Rückenpackung mit einer Hot- Stone Rückenmassage.', '50'),
(21, 2, 'Entsp. Lächeln', '46', 'Sie erhalten eine Gesichtspackung mit Original Rügener Heilkreide, sowie eine entstauende Gesichtslymphdrainage für straffere Gesichtskonturen sowie ein strahlendes Lächeln.', '50'),
(22, 3, 'Kl. Entschlackung', '79', 'Wollen Sie ihren Säure- Basenhaushalt regulieren? Dann wählen Sie dieses Programm! Nach einem Ganzkörperpeeling mit basischem Salz erhalten Sie eine Ganzkörper- Entschlackungspackung. Der Stoffwechsel wird angeregt, das Gewebe entwässert und die Haut gestrafft.', '80'),
(23, 3, 'GK- Basenpeeling', '29', 'Ganzkörper- Peeling mit hochwertigem Edelstein Basensalz', '25'),
(24, 3, 'GK- Entschlackungspackg.', '59', 'Zur Straffung des Bindegewebes und zur Cellulite Behandlung wählen Sie die Entschlackungspackung. Dabei werden Rügener Heilkreide und Algen gemischt und verstärken gegenseitig ihre Wirkung.', '50'),
(25, 3, 'gr. Entschlackungspr.', '99', 'Sie wollten sich schon immer etwas Gutes tun und nehmen sich nie die Zeit dazu? Dann machen Sie es jetzt!\r\nNach einem Ganzkörperpeeling mit einem Edelstein- Basensalz erhalten Sie ein basisches Vollbad, anschließend erfolgt eine Ganzkörpermassage mit straffendem Zitronenöl.', '100'),
(26, 3, 'Entschlackung pur', '111', 'Diese Kombination aus einer Ganzkörper Entschlackungspackung in Verbindung mit einer Hot Stone Entsäuerungsmassage sorgt dafür, dass Ihr Stoffwechsel in Gang gebracht wird und Sie vermehrt überschüssige Säuren ausscheiden. Die Haut wird gestrafft und samtweich. Sie werden komplett aufgewärmt und fühlen sich rundum wohl.', '100'),
(27, 4, 'Hot Stone RM', '29', 'Wenn Sie eine Rückenmassage möchten die nicht weh tut, aber trotzdem Verspannungen löst, dann probieren Sie doch einmal diese Massage mit warmen Steinen aus!', '25'),
(28, 4, 'Hot Stone GM', '29', 'Eine Gesichtsmassage mit Steinen ist unglaublich wohltuend. Warme Steine sorgen dabei für eine Tiefenentspannung und Schläfrigkeit. Die kühlen Marmorsteine erfrischen, straffen und können auch bei Couperose eingesetzt werden.', '25'),
(29, 4, 'Hot Stone Kombi', '58', 'Sehr zu empfehlen ist auch unsere Kombination aus Hot Stone Rücken-, Schulter-, Nacken- und Gesichtsmassage. Diese Anwendung tut besonders gut, wenn man sehr gestresst und nervös ist und zu Spannungskopfschmerzen neigt.', '50'),
(30, 4, 'Hot Stone GK', '58', 'Bei dieser besonders entspannenden Massage wird der ganze Körper mit warmen Steinen und ausgesuchten Ölen massiert. Sie werden ruhig, müde und lassen sich einfach in die Behandlung fallen.', '50'),
(31, 4, 'Hot Stone Ents.', '64', 'Der Ablauf ist wie bei der Hot Stone Ganzkörpermassage. Zusätzlich wird ein basisches Salz einmassiert, das den Säure-Basenstoffwechsel in Gang setzt. Der Körper nimmt über die Haut Basen auf und scheidet überschüssige Säuren aus. Der schönste Nebeneffekt ist eine samtweiche Haut.', '50'),
(32, 5, 'Cremepack.', '59', 'Diese Ganzkörperpackung wird insbesondere bei sehr trockener und schuppiger, sowie sensibler Haut angewendet. Sie führt zu einer intensiven Befeuchtung der Haut und entspannt diese sichtbar.', '50'),
(33, 5, 'Samtweiche Haut', '99', 'Genießen Sie eine sanfte Peelingmassage mit warmem Sanddornöl für den ganzen Körper und eine Sanddornölcremepackung. Sie werden mit einer samtweichen Haut belohnt.', '100'),
(34, 5, 'Frisch und Fruchtig', '99', 'Lassen Sie sich verzaubern vom frischen Duft des Sanddornöls. Genießen Sie ein Sanddornöl- Meersalzpeeling, Sanddornölbad und eine regenerierende Sanddornölmassage.', '100'),
(35, 5, 'Rügen spezial', '65', 'Das ist unsere beliebteste Kombination aus entspannender Sanddornölrückenmassage, warmer Rückenpackung mit Rügener Heilkreide und anregender Sanddornöl- Fußmassage während die Packung wirken kann.', '50'),
(36, 5, 'Sanddornöl Kombi', '58', 'Genießen Sie ein Ganzkörper- Sanddornöl- Meersalzpeeling und eine erfrischende Sanddornöl Gesichtsmassage.', '50'),
(37, 6, 'Romantikbad', '55', 'Sie genießen ein duftendes Bad zu zweit bei sanfter Musik und Kerzenschein mit einem Glas Sekt und süßer Köstlichkeit.', '30'),
(38, 6, 'Romantikbad & RM', '99', 'Erweitern Sie das romantische Bad zu zweit um eine entspannende Rückenmassage pro Person, für noch mehr Wohlbefinden.', '55'),
(39, 6, 'Samtweiche Haut für zwei', '99', 'Genießen Sie ein Ganzkörper- Peeling, welches Ihre Haut samtweich macht und anschließend treffen Sie sich zum Romantikbad.', '55'),
(40, 7, 'Kl. Kosmetik', '52', 'Alle Produkte für diese Behandlung werden auf ihren Hauttyp abgestimmt. Reinigung, Hautdiagnose, Peeling, Vapozon, Ausreinigen, Tonisieren, Maske, ausführliche Gesichts-, Hals-, Nacken- und Dekolletémassage.', '55'),
(41, 7, 'Gr. Kosmetik', '77', 'Sie werden mit einem strahlenden Gesicht belohnt!\r\nWie die kleine Gesichtsbehandlung + Einarbeiten einer Aloe Vera Bio Skin Lift Ampulle mit Soforteffekt + Augenwimpern färben + Augenbrauen faconieren und färben.', '80'),
(42, 7, 'Meeresbrise', '59', 'Meeresschaum Gesichtsreinigung, Ausreinigen, Tonisieren, Original Rügener Heilkreide Gesichtsmaske, Energie- Gesichtsmassage, Hydro Marin Abschlusspflege.', '55'),
(43, 7, 'Zusatzanwendungen', '8', 'Die folgenden Anwendungen können zusätzlich zu einer Gesichtsbehandlung gebucht werden:\r\nAugenbrauen faconieren - 12 €\r\nWimpern färben - 12 €\r\nAugenbrauen färben - 10 €\r\nGesichtsenthaarung mit Wachs - 8 €\r\nAmpulle (je nach Hauttyp) - 8 €', '0'),
(44, 7, 'Augen pur', '30', 'Augenbrauen zupfen, färben und Wimpern färben. Die Korrektur der Augenbrauen sowie das Färben von Augenbrauen und Wimpern gestaltet das Gesicht häufig viel ausdrucksvoller.', '25'),
(45, 7, '"Strahlende Augen"', '57', 'Nach einer Meeresschaum- Gesichtsreinigung werden die Augenbrauen in Form gebracht und gefärbt. Die Wimpern werden ebenfalls frisch gefärbt. Anschließend werden Anti Aging Beauty Pads mit Collagen zur Faltenreduzierung um die Augen fixiert. Zeitgleich wird das ganze mit einer Feuchtigkeitsmaske verwöhnt. Zum Schluss erhalten Sie eine Augenmassage mit Augencreme und eine Abschlusspflege.', '55'),
(46, 7, 'Regenrationsbehandlung mit Meereswirkstoffen', '85', 'Diese Aufbaubehandlung für Gesicht, Hals- und Dekolleté wirkt verjüngend und zeigt schon bei einmaliger Anwendung ein verblüffendes Ergebnis. Die Bio- Cellularprdoukte sind auf Algenbasis mit hochwertigem Vitamin E hergestellt. Diese Behandlung eignet sich insbesondere bei trockener und reifer Haut, bei nachlassender Elastizität und Fältchenbildung. Ihre Haut wird mit Feuchtigkeit gesättigt und dankt es Ihnen mit einem wesentlich glatteren Aussehen.', '80'),
(47, 7, '"Gepflegte Hände"', '52', 'Sie erhalten ein Handbad, Handpeeling, Maniküre, Handpackung und Handmassage. Ihre Hände danken es ihnen mit samtweicher Haut und gepflegtem Aussehen.', '55'),
(48, 7, 'Beatuy for Men', '55', 'Spezielle Gesichtsbehandlung für Ihn, auf die Besonderheiten der männlichen Haut abgestimmt.', '55'),
(49, 7, '"Flinke Füße"', '52', 'Sie erhalten ein Fußbad, Fußpeeling, Pediküre, Fußpackung und Fußmassage. Sie schweben wie auf Wolke 7.', '55'),
(50, 7, 'Anti Couperose Beh.', '55', 'Entstaut und mildert sichtbar rote und blaue Äderchen im Gesicht. Die meist sehr empfindliche und sensible Haut mit Neigung zu erweiterten Äderchen wird hierbei mit hochwertigen Anti Couperose Produkten sowie einer entstauenden Gesichtslymphdrainage behandelt.', '55'),
(51, 8, 'Verwöhnprogramm für Sie', '122', 'Kleine Gesichts-, Hals- und Dekolletébehandlung\r\nAnti Stressmassage\r\nRückenpackung mit Rügener Heilkreide \r\nEnergie Fußmassage', '120'),
(52, 8, 'Verwöhnprogramm für Ihn', '122', 'Anti Stressmassage\r\nRückenpackung mit Rügener Heilkreide \r\nBeauty for Men Gesichtsbehandlung\r\nEnergie Fußmassage', '120'),
(53, 8, 'Der Rücken wird es danken', '144', 'Für dieses Programm benötigen wir 3 Behandlungstage!\r\n1 x Relax Rückenmassage\r\n1 x Anti Stressmassage\r\n1 x Hot Stone Rückenmassage\r\n3 x Rückenpackung mit Rügener Heilkreide \r\nEs werden immer eine Massage und eine Kreidepackung miteinander kombiniert.', '50'),
(54, 8, 'Rügener Heilkreide und Sanddorn', '144', 'Für dieses Programm benötigen wir 1-2 Behandlungstage!\r\n1 x Sanddornöl Gesichtsmassage\r\n1 x Gesichtspackung mit Rügener Heilkreide\r\n1 x Ganzkörper Sanddornölmassage\r\n1 x Ganzkörperpackung mit Rügener Heilkreide', '180'),
(55, 9, 'Halswirbelsäule Spezial', '35', 'Hier liegt das Hauptaugenwerk auf der Behandlung der tiefen Hals- und Nackenmuskulatur aus der Rückenlage. Ich arbeite dabei mit unterschiedlichen Massagetechniken, Akupressur und sanfter Dehnung. Sie können sich anschließend freier bewegen und Sie haben das Gefühl als wäre Ihnen eine Last von den Schultern gefallen. Besonders zu empfehlen bei Verspannungen im Schulter-, Nachenbereich, bei Konzentrationsstörungen und Bewegungseinschränkungen von Hals und Kopf.', '25'),
(56, 9, 'Craniosacrale Therapie', '65', 'Dies ist eine sehr sanfte und wohltuende Therapie aus dem Bereich der Osteopathie. Die Therapie geht vom Schädel bis zum Kreuzbein. Es werden dabei insbesondere die Halswirbel sanft in die richtige Position gebracht. Die Rückenmarksflüssigkeit kann wieder frei fließen und der Gang wird aufrechter. Besonders hilfreich ist diese Therapie bei Migräne, Burnout, Nervosität, Schwindel, Tinnitus, Spannungskopfschmerzen, starken Verspannungen im Brustwirbel-, Hals- und Nackenbereich.', '45'),
(57, 9, 'Beratung', '35', 'Beratung', '35'),
(58, 9, 'Akutbehandlung', '35', 'Akutbehandlung', '35'),
(59, 9, 'Osteopathie', '80', 'Diese Therapie wird meistens bei chronischen Beschwerden im Bewegungsapparat eingesetzt. Dabei wird nicht das eigentliche Symptom behandelt. Der Mensch wird insgesamt gesehen. Ein Beispiel: Kreuzschmerzen können auch von einer verspannten Bauchmuskulatur kommen. Oder Schmerzen unter dem rechten Schulterblatt weil sich die Leber in Ihrer eigentlichen Lage verändert hat. Nach einem Gespräch führe ich die Untersuchung durch, die oft unmerklich in die Behandlung übergeht. Viele gesetzliche Krankenkassen übernehmen die Kosten für Osteopathie bereits teilweise. Wenn die Kostenübernahmen für Sie entscheidend für eine Behandlung ist, erkundigen Sie sich bitte vor Terminabsprache ob Ihre Krankenkasse die Kosten übernimmt. Ich bin Mitglied im "Verband freier Osteopathen e.V." (VfO).', '45'),
(60, 9, 'Kinesio Taping', '15', 'Beim Kinesio- Taping werden elastische Bänder in unterschiedlichen Mustern auf die Haut geklebt. Dadurch wird der Lymphfluss im behandelten Bereich angeregt. Mit der Lymphe werden Entzündungsstoffe aus dem therapierten Gebiet abtransportiert. Die Schmerzlinderung und Heilung wird unterstützt. Der behandelte Bereich ist weiterhin beweglich, wird aber trotzdem gestützt. Sehr zu empfehlen ist das Taping in Verbindung mit der Craniosacralen oder viszeralen Osteopathie, aber auch bei Verletzungen oder chronischen Schmerzen einzelner Gelenke.', '15'),
(61, 9, 'Reiki', '65', 'Reiki heißt universelle Energie. Durch das Auflegen der Hände auf die Energiezentren des Körpers wird Energie übertragen. Diese Anwendung wird sehr beruhigend und löst keinen zusätzlichen Reiz im Körper aus. Reiki ist besonders geeignet bei Erschöpfung, Überforderung, depressiven Verstimmungen und allen chronischen Krankheiten.', '45'),
(62, 9, 'Manuelle Lymphdrainage', '65', 'Das Lymphgefäßsystem ist neben dem Blutkreislauf das zweite große Gefäßsystem in unserem Körper. Mit der Lymphdrainage werden Schlacke und Entzündungsstoffe aus unserem Körper abtransportiert. Funktioniert der Lymphabfluss nicht, kommt es zum Beispiel zu geschwollenen Händen oder Füßen. Oder man hat das Gefühl, das Gesicht ist geschwollen oder der Bauch aufgetrieben. Außerdem eignet sich diese sanfte Form der Behandlung sehr zur Unterstützung bei Fastenkuren und Ernährungsumstellung.', '45'),
(63, 9, 'Bachblütentherapie- Die Seele ins Gleichgewicht bringen', '70', 'Dr. Bach erkannte, das seelische Ungleichgewichte für das Auftreten von Krankheiten verantwortlich sein können. Bachblüten helfen, mit negativen Gefühlen (z.B. Angst, Unsicherheit, Ungeduld, Trauer, Hoffnungslosigkeit usw.) besser klar zu kommen. Die Bachblüten helfen insbesondere bei großen Umbrüchen in der Lebensplanung wie z.B. Berufswechsel, Trennungen, Familienplanung, während oder nach überstandenen Krankheiten, psychischen Belastungen, in der Pubertät und Wechseljahren. Nach einem ausführlichen Gespräch werden die für Sie in Frage kommenden Bachblüten kinesiologisch ausgetestet. Sie erhalten Ihre persönliche fertig gemixte Bachblütenmischung sofort zum Mitnehmen.', '50'),
(64, 9, 'Homöopathie', '140', 'Die Homöopathie geht davon aus, dass Krankheitssymptome nicht die Krankheit selbst sind, sondern Reaktionen auf die Störursachen, die zeigen, dass der Körper selbsttätig wieder das Gleichgewicht herstellen will. Die Homöopathie versucht also nicht die Symptome zu unterdrücken, sondern die Selbstheilungskräfte des Körpers anzuregen.\r\nSie wirkt überall dort wo die Körpereigene Regulation noch erhalten ist und grundsätzlich eine Möglichkeit zur Selbstheilung besteht. Dies gilt für viele akute Erkrankungen, besonders solche im Kindesalter und für psychosomatische oder chronische Krankheiten.\r\nEine homöopathische Behandlung ist sehr aufwendig. Es kann nur das richtige Mittel gefunden werden, wenn der Behandler nicht nur die Krankheitszeichen, sondern den Patienten insgesamt sehr gut kennt.', '120'),
(65, 9, 'Muskelentspannung nach Jacobsen', '65', 'Das ist ein einfach zu erlernendes Entspannungsverfahren. Es ist für jeden geeignet und lässt sich sehr gut zu Hause und auf der Arbeit umsetzen. Vorerkrankungen oder Alter spielen dabei keine Rolle. Jeder der innerlich zur Ruhe kommen möchte, ist nach dieser Behandlungseinheit dazu in der Lage. Besonders geeignet bei nervösen Unruhezuständen, zum Stressabbau, bei Angststörungen und allen chronischen Erkrankungen.', '45'),
(66, NULL, 'Rügen entspannt genießen', '45', 'Sanddornöl- Rückenmassage & warme Rückenpackung mit Rügener Heilkreide', '50');
